import React from "react";

function Hero() {
  return (
    <section id="hero">
      <h1>Hi, I'm Aayush Duwal</h1>
      <h2>
        BCA Student @ Kathford International College of Engineering and
        Management
      </h2>
      <p>I build things for the web.</p>
    </section>
  );
}

export default Hero;
